import React from "react";
import { Button } from "react-bootstrap";

function SearchButton ({children, OnClick}) {
    return (
        <div>
            <Button variant="light"
            id={children}
            onClick={OnClick}
            >
                Search
                </Button> 
        </div>
    )
}
export default SearchButton;
